export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:i,pageSize:25,pageCount:i,total:10}}},nOs8FzumTI:{data:{id:1863,attributes:{imdbId:"tt0068997",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzU2MzQyNTEtNWUxMy00Y2M3LWJhMTktZjk0NjNmYjAwN2RlXkEyXkFqcGdeQXVyMjI4MjA5MzA@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"}],item_lang:{data:{id:2526,attributes:{title:f,plot:"A group of new police recruits takes to patrolling the streets of Los Angeles. Roy Fehler is a law student with a family and has joined the LAPD until he can complete his degree. He's partnered with veteran patrolman Kilvinski and they soon develop a good rapport. On the street the policemen are exposed to the seedier side of life but Kilvinski is a fair cop and a good teacher. Over time however, Fehler comes to love the work and both his family and his studies fall by the wayside. Kilvinsky retires and Fehler loses his way, drinking heavily. Fehler's wife leaves him and he soon hits bottom. Just as he begins to get his life in order, fate intervenes.",slug:"the-new-centurions"}}},books:{data:[{id:9449,attributes:{title:f,description:j,thumbnail:k,authors:[b],firstBook:true,published:g,publisher:h,subtitle:d}},{id:9450,attributes:{title:f,description:j,thumbnail:k,authors:[b],firstBook:e,published:g,publisher:h,subtitle:d}},{id:9451,attributes:{title:"The Choirboys",description:"“Each wears his cynicism like a bulletproof jockstrap—each has his horror story, his bad dream, his nightshriek. He is afraid of his friends—he is afraid of himself.”—New York Times Partners in the Los Angeles Police Department, they’re haunted by terrifying dark secrets of the nightwatch–shared predawn drink and sex sessions they call choir practice. “A master storyteller . . . authenticity oozes from this book . . . freewheeling and chilling and certainly Wambaugh's best.”—Houston Chronicle",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=5gXSRNlMClcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:l,publisher:m,subtitle:"A Novel"}},{id:9452,attributes:{title:"The Blue Knight",description:"Ex-cop turned #1 New York Times bestselling writer Joseph Wambaugh forged a new kind of literature with his great early police procedurals. Gritty, luminous, and ultimately stunning, this novel is Wambaugh at his best--a tale of a street cop on the hardest beat of his life. Twenty and two. Those are the numbers turning in the mind of William \"Bumper\" Morgan: twenty years on the job, two days before he \"pulls the pin\" and walks away from it forever. But on the gritty streets of L.A., people look at Bumper like some kind of knight in armor--they've plied him with come-ons, hot tips, and the hard respect a man can't earn anywhere else. Now, with a new job and a good woman waiting for him, a kinky thief terrorizing L.A.'s choice hotels, and a tragedy looming, Bumper Morgan is about to face the only thing that can scare him: the demons that he's been hiding behind his bright and shiny badge...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kMqOCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:g,publisher:h,subtitle:d}},{id:9453,attributes:{title:"The Onion Field",description:"NEW YORK TIMES BESTSELLER • “A fascinating account of a double tragedy: one physical, the other psychological.”—Truman Capote This is the frighteningly true story of two young cops and two young robbers whose separate destinies fatally cross one March night in a bizarre execution in a deserted Los Angeles field. “A complex story of tragic proportions . . . more ambitious than In Cold Blood and equally compelling!”—The New York Times “Once the action begins it is difficult to put the book down. . . . Wambaugh’s compelling account of this true story is destined for the bestseller lists.”—Library Journal",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Lb_KPdKfQ0YC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:l,publisher:m,subtitle:d}}]}}},meta:{}}},prerenderedAt:1694069504030}}("movie","Joseph Wambaugh","series","",null,"The New Centurions","2008-04-01","Hachette UK",1,"Ex-cop turned #1 New York Times bestselling writer Joseph Wambaugh forged a new kind of literature with his great early police procedurals. Here in his classic debut novel, Wambaugh presents a stunning, raw, and unforgettable depiction of life behind the thin blue line. In a class of new police recruits, Augustus Plebesly is fast and scared. Roy Fehler is full of ideals. And Serge Duran is an ex-marine running away from his Chicano childhood. In a few weeks they'll put on the blue uniform of the LAPD. In months they'll know how to interpret the mad babble of the car radio, smell danger, trap a drug dealer, hide a secret, and-most of all-live with the understanding that cops are different from everyone else. But for these men, these new centurions, time is an enemy. The year is 1960. The streets are burning with rage. And before they can grow old on this job, they'll have to fight for their lives...","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a8qOCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2008-11-26","Delta"))